import React, { Component } from "react";
import logo from "../logo.svg";
import ComingSoon from "./ComingSoon";

class App extends Component {
  state = {
    countdown: {
      futureDate: "2019-08-31 00:00:00"
    },
    logo: {
      alt: "Spinning React Logo",
      src: logo,
      spinSpeed: "slow"
    },
    title: {
      text: "Coming Soon!"
    },
    description: {
      text: "This website will be up and running shortly."
    },
    subscribe: {
      placeholder: "Enter Email Address",
      buttonText: "Submit"
    },
    links: [
      {
        url: "https://www.facebook.com/JasonAlvernaz",
        logo: "https://image.flaticon.com/icons/svg/220/220200.svg",
        text: "Join"
      },
      {
        url: "https://www.twitter.com/JasonAlvernaz",
        logo: "https://image.flaticon.com/icons/svg/145/145812.svg",
        text: "Follow"
      }
    ]
  };
  render() {
    const {
      countdown,
      logo,
      title,
      description,
      subscribe,
      links
    } = this.state;
    return (
      <ComingSoon
        countdown={{
          futureDate: countdown.futureDate
        }}
        logo={{
          alt: logo.alt,
          src: logo.src,
          spinSpeed: logo.spinSpeed
        }}
        title={{
          text: title.text
        }}
        description={{
          text: description.text
        }}
        subscribe={{
          placeholder: subscribe.placeholder,
          buttonText: subscribe.buttonText
        }}
        links={links}
      />
    );
  }
}

export default App;
